import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { RootState } from './app/store';
import { setCryptos, updateCryptoPrice } from './features/crypto/cryptoSlice';
import './App.css';

interface CryptoData {
  id: string;
  name: string;
  symbol: string;
  logo: string;
  price: number;
  change1h: number;
  change24h: number;
  change7d: number;
  marketCap: number;
  volume24h: number;
  circulatingSupply: number;
  maxSupply: number | null;
  chartUrl: string;
}

const mockCryptoData: CryptoData[] = [
  {
    id: 'bitcoin',
    name: 'Bitcoin',
    symbol: 'BTC',
    logo: 'https://cryptologos.cc/logos/bitcoin-btc-logo.png',
    price: 35000,
    change1h: 0.5,
    change24h: 2.5,
    change7d: -1.2,
    marketCap: 680000000000,
    volume24h: 28500000000,
    circulatingSupply: 19500000,
    maxSupply: 21000000,
    chartUrl: '/mock-btc-chart.svg'
  },
  {
    id: 'ethereum',
    name: 'Ethereum',
    symbol: 'ETH',
    logo: 'https://cryptologos.cc/logos/ethereum-eth-logo.png',
    price: 2000,
    change1h: -0.2,
    change24h: 1.8,
    change7d: 3.5,
    marketCap: 240000000000,
    volume24h: 15700000000,
    circulatingSupply: 120000000,
    maxSupply: null,
    chartUrl: '/mock-eth-chart.svg'
  },
  { id: 'cardano', name: 'Cardano', symbol: 'ADA', logo: '', price: 1.2, change1h: 0, change24h: -0.5, change7d: 0, marketCap: 40000000000, volume24h: 1200000000, circulatingSupply: 31000000000, maxSupply: null, chartUrl: '' },
  { id: 'solana', name: 'Solana', symbol: 'SOL', logo: '', price: 98, change1h: 0, change24h: 3.2, change7d: 0, marketCap: 42000000000, volume24h: 2100000000, circulatingSupply: 200000000, maxSupply: null, chartUrl: '' },
  { id: 'polkadot', name: 'Polkadot', symbol: 'DOT', logo: '', price: 15.8, change1h: 0, change24h: -1.2, change7d: 0, marketCap: 18500000000, volume24h: 980000000, circulatingSupply: 1000000000, maxSupply: null, chartUrl: '' },
  { id: 'avalanche', name: 'Avalanche', symbol: 'AVAX', logo: '', price: 35.4, change1h: 0, change24h: 4.1, change7d: 0, marketCap: 12800000000, volume24h: 890000000, circulatingSupply: 340000000, maxSupply: null, chartUrl: '' },
  { id: 'chainlink', name: 'Chainlink', symbol: 'LINK', logo: '', price: 14.2, change1h: 0, change24h: 0.8, change7d: 0, marketCap: 8200000000, volume24h: 650000000, circulatingSupply: 1000000000, maxSupply: null, chartUrl: '' }
];

function App() {
  const dispatch = useDispatch();
  const { cryptos } = useSelector((state: RootState) => state.crypto);

  useEffect(() => {
    dispatch(setCryptos(mockCryptoData));

    const interval = setInterval(() => {
      mockCryptoData.forEach(crypto => {
        const randomChange = (Math.random() - 0.5) * 2;
        const newPrice = crypto.price * (1 + randomChange / 100);
        dispatch(updateCryptoPrice({
          id: crypto.id,
          price: newPrice,
          change1h: crypto.change1h + randomChange / 8,
          change24h: crypto.change24h + randomChange / 4,
          change7d: crypto.change7d + randomChange / 2,
        }));
      });
    }, 3000);

    return () => clearInterval(interval);
  }, [dispatch]);

  const formatNumber = (num: number, isCurrency: boolean = false): string => {
    if (num >= 1e9) {
      return `${isCurrency ? '$' : ''}${(num / 1e9).toFixed(2)}B`;
    }
    if (num >= 1e6) {
      return `${isCurrency ? '$' : ''}${(num / 1e6).toFixed(2)}M`;
    }
    return `${isCurrency ? '$' : ''}${num.toLocaleString(undefined, {
      minimumFractionDigits: 2,
      maximumFractionDigits: 2,
    })}`;
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Crypto Tracker</h1>
      </header>
      <div className="table-container">
        <table className="crypto-table">
          <thead>
            <tr>
              <th>#</th>
              <th style={{ textAlign: 'left' }}>Name</th>
              <th>Symbol</th>
              <th>Price</th>
              <th>1h %</th>
              <th>24h %</th>
              <th>7d %</th>
              <th>Market Cap</th>
              <th>24h Volume</th>
              <th>Circulating Supply</th>
              <th>Max Supply</th>
              <th>7D Chart</th>
            </tr>
          </thead>
          <tbody>
            {cryptos.map((crypto, index) => (
              <tr key={crypto.id}>
                <td>{index + 1}</td>
                <td className="name-cell">
                  <img 
                    src={crypto.logo} 
                    alt={`${crypto.name} logo`} 
                    className="crypto-logo"
                  />
                  <span className="crypto-name">{crypto.name}</span>
                </td>
                <td>{crypto.symbol}</td>
                <td>{formatNumber(crypto.price, true)}</td>
                <td className={`change-cell ${crypto.change1h >= 0 ? 'positive' : 'negative'}`}>
                  {crypto.change1h > 0 ? '+' : ''}{crypto.change1h.toFixed(2)}%
                </td>
                <td className={`change-cell ${crypto.change24h >= 0 ? 'positive' : 'negative'}`}>
                  {crypto.change24h > 0 ? '+' : ''}{crypto.change24h.toFixed(2)}%
                </td>
                <td className={`change-cell ${crypto.change7d >= 0 ? 'positive' : 'negative'}`}>
                  {crypto.change7d > 0 ? '+' : ''}{crypto.change7d.toFixed(2)}%
                </td>
                <td>{formatNumber(crypto.marketCap, true)}</td>
                <td>{formatNumber(crypto.volume24h, true)}</td>
                <td>{formatNumber(crypto.circulatingSupply)} {crypto.symbol}</td>
                <td>{crypto.maxSupply ? formatNumber(crypto.maxSupply) : '∞'}</td>
                <td className="chart-cell">
                  <img 
                    src={crypto.chartUrl} 
                    alt={`${crypto.name} 7-day chart`} 
                    className="mini-chart"
                  />
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default App;
